#define PIPE_MATCH_ACTION_MAX_SIZE 128

#define BYTE_ROUND_UP(x) ((x + 7) >> 3)

bf_drv_client_handle_t bf_drv_hdl;

static void build_pd_res_spec(pipe_action_spec_t *action_spec,
                              pd_res_spec_t **res_spec,
                              int *resource_cnt) {
  if (action_spec->resource_count) {
    *res_spec = bf_sys_calloc(action_spec->resource_count,
                              sizeof(pd_res_spec_t));
    unsigned i = 0;
    int idx = 0;
    for (i = 0; i < action_spec->resource_count; i++) {
      if (action_spec->resources[i].tag == PIPE_RES_ACTION_TAG_ATTACHED) {
        (*res_spec)[idx].tbl_hdl = action_spec->resources[i].tbl_hdl;
        (*res_spec)[idx].tbl_idx = action_spec->resources[i].tbl_idx;
        idx++;
      }
    }
    *resource_cnt = idx;
  } else {
    *resource_cnt = 0;
  }
  return;
}




static bf_status_t p4_pd_netbufferv4_dev_remove(bf_dev_id_t dev_id) {

  p4_pd_ms_destroy_txn_state_for_dev(dev_id);
  return BF_SUCCESS;
}

static bf_status_t p4_pd_netbufferv4_dev_log(bf_dev_id_t dev_id, cJSON *pd_node) {
  cJSON *profs, *prof;
  cJSON_AddStringToObject(pd_node, "name", "netbufferv4");
  cJSON_AddItemToObject(pd_node, "act_profs", profs = cJSON_CreateArray());

  return BF_SUCCESS;
}

static bf_status_t p4_pd_netbufferv4_dev_restore(bf_dev_id_t dev_id, cJSON *pd_node) {
  cJSON *profs, *prof;

  profs = cJSON_GetObjectItem(pd_node, "act_profs");
  for (prof = profs->child; prof; prof = prof->next) {
  }

  return BF_SUCCESS;
}

void p4_pd_netbufferv4_init(void) {
  p4_pd_ms_init();

  bf_status_t r = bf_drv_register("p4_pd_netbufferv4_pd", &bf_drv_hdl);
  assert(r == BF_SUCCESS);
  bf_drv_client_callbacks_t callbacks = {0};
  callbacks.device_del = p4_pd_netbufferv4_dev_remove;
  callbacks.device_log = p4_pd_netbufferv4_dev_log;
  callbacks.device_restore = p4_pd_netbufferv4_dev_restore;
  bf_drv_client_register_callbacks(bf_drv_hdl, &callbacks, BF_CLIENT_PRIO_2);
}

void p4_pd_netbufferv4_device_state_cleanup(uint8_t device_id) {
}

void p4_pd_netbufferv4_cleanup(void) {

  p4_pd_ms_cleanup();

  bf_drv_deregister(bf_drv_hdl);
}

